import React, { useState } from "react";
import "./App.css";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import { ThemeProvider, createTheme, Typography } from "@mui/material";
import MovingComponent from 'react-moving-text'

import FlashcardList from "./FlashcardList";
import Appbar from "./components/Appbar";
import Education from "./components/Education";
import Digicam from "./components/Digicam";
import Design from "./components/Design";
import Contacts from "./components/Contacts";

const flashcard_component = [
  {
    id: 1,
    project_name: "Website development",
    details: "word",
  },
  {
    id: 2,
    project_name: "Data Visualization Project",
    details: "word2",
  },
  {
    id: 3,
    project_name: "Data Visualization Hackathon",
    details: "word3",
  },
];

function App() {
  const [flashcards, setFlashcards] = useState(flashcard_component);

  const theme = createTheme({
    typography: {
      h1: {
        fontFamily: "myFirstFont",
      },
      h2: {
        fontFamily: "myFirstFont",
      },
      p: {
        fontFamily: "louis",
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <Box
        sx={{
          color: "black",
          background:
            "linear-gradient(to right, #b4c0cf, #e8bdbe, #f4d2b5, #d4d5c8)",
        }}
      >
        <Stack className="App">

          <Appbar />

          <div className="title">
            <br />
            <br />
            <Typography variant="h1"> Alice Lee </Typography>
            <br />
            <br />
            <br />
          </div>

          <MovingComponent
  type="blur"
  duration="2000ms"
  delay="0s"
  direction="normal"
  timing="ease"
  iteration="5"
  fillMode="none">
  React-Moving-Text
</MovingComponent>

          <Education />

          <FlashcardList flashcards={flashcards} />

          <Design />

          <Digicam />

          <Contacts />

        </Stack>
      </Box>
    </ThemeProvider>
  );
}

export default App;
